create database shop;

\c shop;

create table customer_addresses (
	id SERIAL PRIMARY KEY,
	first_name VARCHAR(50),
	last_name VARCHAR(50),
	email VARCHAR(50),
	res_address VARCHAR(50),
	work_address VARCHAR(50),
	country VARCHAR(50),
	State VARCHAR(50),
	phone_1 VARCHAR(50),
	phone_2 VARCHAR(50)
);

